INSERT INTO `specifications` VALUES (1,'Hylas','',NULL,46,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-15 23:29:39','2009-03-19 21:26:46','Form and function combine with the keen eye and steady hand of renowned designer German Frers to produce this \"must-see\" cruising yacht. A true watertight collision bulkhead forward and another aft define the 46 as a serious offshore yacht. But it gets even better. Step below into a world of refined elegance, beautifully hand-finished teak furniture, splendid totally private comfort for two couples, plus room for up to three additional guests. Abundant storage, unsurpassed electrical and mechanical systems. Top-shelf hardware in every application. A fantastic seagoing galley worthy of a much larger yacht. In addition to a commanding specification that has been refined by thousands of miles at sea and the invaluable input of our many yacht owners, the Hylas 46 sparkles with a confident profile, a robust and modern sailplan, and a generous beam that carries well aft to provide both excellent stability and more interior volume than other yachts, all in just 46 feet. This may be all the boat you\'ll ever need! (hylasyachtsusa.com)',NULL,NULL),(2,'Hylas','',NULL,49,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-15 23:42:23','2009-03-19 21:27:05','Her sweet sheer and elongated more traditional lines are the unmistakable hallmark of legendary yacht designers, Sparkman and Stephens. Known for her crisp performance and elegant hand-finished teak interior, she is an absolute joy to handle, even with small crew. The integrity assured by her solid laminate hull and watertight bulkheads further speak to her mission as a reliable offshore performer or elegant coastal cruiser. A feature-filled interior incorporates three double cabins, extraordinary in a 49-footer. The fully -equipped galley spans one of the two passageways to the aft stateroom. On deck, her deep and secure center cockpit provides perfect visibility from the helm and seats long enough to accommodate a relaxing nap. The reverse transom with wide steps and an integrated boarding ladder make getting aboard or off a breeze, whether from the water or from your dinghy. But the best part of her may be the delightfully positive helm that transmits her smooth energy to your fingertips... a spirited thoroughbred responding to your every command as the sea turns to diamonds, carrying you safely to your far destination.(hylasyachtsusa.com)',NULL,NULL),(3,'Hylas','',NULL,54,'','','','','','','','','','','','','German Frers','','','','','','','',NULL,NULL,'2009-03-15 23:53:40','2009-04-19 16:25:01','Comes in standard and raised salon versions.',NULL,''),(5,'Hylas','Center Cockpit',NULL,44,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-17 20:43:15','2009-03-17 20:45:44','',NULL,NULL),(6,'Hylas','Center Cockpit',NULL,47,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-17 20:43:51','2009-03-17 20:45:51','',NULL,NULL),(7,'Hylas','Center Cockpit',NULL,51,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-17 20:44:15','2009-03-17 20:46:24','',NULL,NULL),(8,'Hylas','',NULL,45,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 21:39:34','2009-03-19 21:39:34','',NULL,NULL),(9,'Sabre','Mark I',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:01:41','2009-03-19 22:01:41','',NULL,NULL),(10,'Sabre','Mark II',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:02:22','2009-03-19 22:02:22','',NULL,NULL),(11,'Hans Christian','Explorer',NULL,47,'','','','','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:06:04','2009-04-19 19:20:37','',NULL,''),(12,'Allied','XL-2',1962,42,'30\'10\"','41\'9\'',NULL,'11\'6\"','4\'2\"','8\'4\"','','19770 pounds','7000 pounds','','7.461 knots','Fiberglass','Sparkman & Stevens','30-50 gallons','100 gallons','','Westerbeke','','Diesel','',NULL,NULL,'2009-03-19 22:06:55','2009-04-17 15:15:12','Designed by Sparkman & Stevens, the XL-2 came on the market in 1969 and was built all the way until Allied\'s final collapse in 1981. Allied\'s flagship model, the XL-2 disputably has the best interior and exterior finish and the best sailing ability of any Allied model. The XL-2 uses a keel-centerboard system that draws only 4\'2\" when the board is up, ideal for shallow-water sailing. One of the last XL-2\'s built, Dauphine, was designed and constructed with a fixed keel, drawing 5\'11\". <a href=\"http://www.sailboattraderonline.com/listing/1981-Allied-42-XL-Cutter-94324766\">Dauphine</a> is currently, April 2009, on the market!  An XL-2 can be purchased for about $70,000 to $100,000. (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',100000,'1 year'),(14,'Amel','Maramu',1979,48,'36\'','48\'',NULL,'13\'2\"','6\'6','','','','8,820','','','Fiberglass','Amel & Carteau','','','','','','','',NULL,NULL,'2009-03-19 22:14:07','2009-04-16 17:52:25','The Amel 48 is a legendary yacht renowned for it\'s seaworthy-ness. Favored by Henri Amel himself.  Like other Amel\'s, it is well watertight.  Prices can range from 100,000 to 200,000.',180000,''),(15,'Amel','Super Maramu',2000,53,'41','53\'',NULL,'15\'','7\'','','','35280','12125','7','8','Fiberglass','Henri Amel J. Carteau','158','263','','','','','',NULL,NULL,'2009-03-19 22:15:50','2009-04-16 17:52:11','The Super Maramu is a cruiser with 2 heads and 2 staterooms.  Prices range from 350,00 to 600,000 with plenty around.',500000,''),(16,'Beneteau','Oceanis 430',1986,43,'36\' 11\"','42\' 7\" ',NULL,'13\' 10\" ','5\' 11\"','','','19,800 lbs. ','','','','Fiberglass',' Philippe Briand','','','','','','','',NULL,NULL,'2009-03-19 22:17:48','2009-04-16 18:24:18','The 430 is another popular Beneteau make, though not as common as some of the larger Beneteau\'s.  It is a quick sailing, passageway yacht.  Prices range from 100,000 to 160,000.',150000,'2 years'),(18,'Beneteau','Moorings 505',NULL,50,'','49\'10\"',NULL,'','','','','','','','','Fiberglass','Bruce Farr','','','','','','','',NULL,NULL,'2009-03-19 22:19:55','2009-04-16 18:16:16','The 505 is the four cabin version of the Oceanis 500.  It also comes in a five cabins, both designed by Bruce Farr.  Like the 50, 505\'s are common on the used market.  They sell for around 150,000 to 200,000 dollars.   It is designed for chartering.  The Oceanis 440 also has a Moorings 450 for chartering.',190000,'1 year'),(19,'Beneteau','Moorings 445',NULL,44,'','',NULL,'','','','','','','','','Fiberglass','Bruce Farr','','','','','','','',NULL,NULL,'2009-03-19 22:22:05','2009-04-16 18:09:49','The 445/440 is like the 505/500, a slightly larger version by Bruce Farr.  It is designed for optimal chartering.   445 are much less common than 440\'s.  You should find one for around $110,000.',110000,'2 years'),(20,'Beneteau','Oceanis 440',NULL,44,'36\' 5\" ','44\' 10\" ',NULL,'14\' 0\"','5\' 9\" ','','','20,500 lbs. ','7,055 lbs.','','','Fiberglass','Bruce Farr',' 53 gal.','145 gal.','','','','','78 hp.',NULL,NULL,'2009-03-19 22:22:42','2009-04-16 18:07:53','Another common boat like the Beneateau 47 and 50\'s.  Buyers should find one easily on the used market.  The market abound with customs.  Prices can range from 300,000 to 80,000 dollars.',140000,'1 year'),(22,'Beneteau','Oceanis 500',1988,50,'44\' 6\" ','50\' 3\"',NULL,'15\' 7\"','6\' 0\"','','','28,660 lbs. ','10,800 lbs.','','','Fiberglass','Briand','','263 gal.','','','','','80 hp.',NULL,NULL,'2009-03-19 22:37:47','2009-04-16 18:18:45','Beneteau\'s 500 model is common but with high variability.  500\'s come in many different custom designs with two, three, and four cabin versions.  The price vary, too, from 120,000 to 400,000.  The 500 and its custom version make up Beneteau\'s most popular and common cruising sailboat.',300000,'2 years'),(26,'Beneteau','Oceanis 510',1991,50,'44\' 58\" ','50\' 17\" ',NULL,'15\' 58\" ','','','','30,860 lbs.','10,800 lbs.','','','Fiberglass','Briand','148 gal.','276 gal.','','','','','80 hp',NULL,NULL,'2009-03-19 22:46:03','2009-04-16 17:51:59','The 510 is a slightly larger and less common version of the popular Oceanis 500.  It is great for family cruising.',200000,'1 year'),(28,'Fort Myers','Brewer 42',1975,42,'','',NULL,'','','','','','','','','Fiberglass','Ted Brewer','','','','','','','',NULL,NULL,'2009-03-19 23:00:14','2009-04-16 20:22:55','Also, Whitby built the same Brewer design earlier.  Fort Myers manufactured stronger boats.  The designer, <a href=\"http://www.tedbrewer.com/\">Ted Brewer</a>, is retired now in B.C. and does consulting.  He studied under, among others, Bill Luders. 42\'s have 3 cabins and 2 heads.  They are center cockpit designs.  Brewer 42\'s sell for 120,00 to 150,000.  Sometimes, it takes awhile for a special buyer.',150000,'3 years'),(29,'Fort Myers','Brewer 44',NULL,44,'','',NULL,'','','','','','','','','Fiberglass','Ted Brewer','','','','','','','',NULL,NULL,'2009-03-19 23:01:06','2009-04-16 20:18:46','Designed by Ted Brewer.  Prices range from 170,000 to 250,000.',220000,'2 years'),(30,'Bruce Roberts','Mauritius',NULL,44,'','',NULL,'','','','','','','','','Fiberglass','Bruce Roberts','','','','','','','',NULL,NULL,'2009-03-19 23:02:00','2009-04-16 21:05:26','Prices range from $100,000 to $150,000.',150000,'2 years'),(31,'C&C','',NULL,54,'','',NULL,'','','','','','','','','Fiberglass','','','','','','','','',NULL,NULL,'2009-03-19 23:03:22','2009-04-16 23:04:56','The C&C 54 is a rare find. These layouts are a pilothouse version.  It sells for around $200,000. These larger C&C are not only racers but durable cruisers.  A 61\'one named Sorcery survived a Rogue Wave without much damage.',200000,'3 years'),(32,'Cabo Rico','38',1978,38,'','41\'','38\'','11\'6\"','5\'','','','21,500','','','','Fiberglass','W. I. B. Crealock','','','','','','','',NULL,NULL,'2009-03-19 23:04:33','2009-04-18 15:19:11','Cabo Rico\'s signature boat.  Designed by \"Gentleman Bill\" Crealock in the 1970\'s.  Crealock is the designer of the classic Westsail 32. They are still making these 38\'s, so the price varies widely with age from 90000 to 180000.  The newer ones have redesigned interiors. Cabo Rico also makes XL and pilothouse versions.',180000,'2 years'),(33,'Catalina','',1986,34,'','','','','','','','','','','','Fiberglass','Gerry Douglas','','','','','','','',NULL,NULL,'2009-03-19 23:05:29','2009-04-18 20:30:14','Another Catalina with a ton available on the market.  Also, available is a Mk II redesign.  The design is influenced by the new Morgan people after the, then recent, takeover of Morgan in 1984.  Price is about $60,000.',60000,'1 year'),(34,'Catalina','400',1995,40,'','','','','','','','','','','','Fiberglass','Gerry Douglas','','','','','','','',NULL,NULL,'2009-03-19 23:06:24','2009-04-18 20:11:10','The 400 comes in 2 and 3 cabin models like the 470 Catalina.  Prices are about $160,000.',160000,'1 year'),(36,'Catalina','470',1998,47,'42\'','47\'11\"','46\'4\"','14\'','5\'9\"','7\'10\"','','','','','','Fiberglass','Gerry Douglas','','','','','','','',NULL,NULL,'2009-03-19 23:07:42','2009-04-18 19:51:42','Comes in 2 and 3 cabins models with both still in production.  The 470 is a recent make, started in 1998.  Priced from 230,000 to 350,000 dollars with many on the the market.  Catalina is famous for its smaller racing 22\' and 30\' boats but is moving into ocean cruisers.  Gerry Douglas has designed all Catalina models since 1982 including this 470.',300000,'1 year'),(38,'Lagoon','380',1999,38,'','','','','','','','','','','','Fiberglass','Van Peteghem & Lauriot Prevost','','','','','','','',NULL,NULL,'2009-03-19 23:23:38','2009-04-19 23:04:19','This is a catamaran.  The Lagoon design came out of the builder Jeanneau and is now a subsidiary of Beneteau.  These Lagoons are common on the used market.',260000,'2 years'),(39,'Voyage','Norseman',1996,43,'','','','','','','','','','','','Fiberglass','Alexander Simonis','','','','','','','',NULL,NULL,'2009-03-19 23:24:09','2009-04-19 21:38:54','The Norseman is a catamaran.  It is <a href=\"http://www.sailingcatamarans.com/faqs.htm#charter\">criticized</a> as only a charter model, uncomfortable and unseaworthy for cruising.  Prices range from $230,000 to $285,000.  Voyage Yachts is an American maker of charter catamarans.  ',285000,'1 year'),(40,'Cheoy Lee','Offshore',1972,47,'33\' ','46\' 10\"','','12\' 6\"','6\' 8\"','','','26,500 lbs','10,000 lbs cast iron','','','Fiberglass','A. E. Bill Luders','','','','Universal','','gas','70',NULL,NULL,'2009-03-19 23:26:20','2009-04-19 01:08:02','Designed by Bill Luders who also did the Allied Luders 33.  Cheoy Lee once was a great cruising brand out of Hong Kong but has switched to power.  Comes in sloop, ketch, and yawl types.  Price tops out at maybe $180,000.  Should be one on the used market.',170000,'2 years'),(41,'Cheoy Lee','Perry Offshore',1979,48,'','47\'10','','13\'9','6\'6','','','32,300','','','','Fiberglass','Robert Perry','','','','','','','',NULL,NULL,'2009-03-19 23:26:49','2009-04-19 00:56:56','Also known as the Perry 48 or Cheoy Lee 48.  These come in many varieties including: ketch/sloop, center/aft cockpit, and 2/3 cabin.  These days Cheoy Lee makes only big power boats.  Designed by Robert Perry, the design critic in Sailing magazine.  It is a classic cruiser.  The used market doesn\'t have very many.   See if you can find one for around $100,000.',120000,'4 years'),(42,'CSY','',1978,37,'29\'2\"','','37\'2\"','12\'','4\'7\"','6\'2\"','','','','','','Fiberglass','Peter Schmidt','','','','','','','',NULL,NULL,'2009-03-19 23:27:34','2009-04-19 14:15:12','The 37 is CSY\'s other model than the 44\'.  John R. Van Ost started CSY in 1976 but went out of business in 1981.  They made tough chartering yachts.  These are less common than the 44\' model, but you should find one.  Price is around $50,000.',50000,''),(44,'CSY','',1977,44,'36\'3\"','','44\'','13\'3\"','','6\'5\"','','37,000','12,000','','','Fiberglass','Peter Schmidt, Ted Irwin','','','','','','','',NULL,NULL,'2009-03-19 23:30:14','2009-04-19 14:07:25','<a href=\"http://www.marill.com/csy/The%20CSY%20Story/the_csy_story.htm\">CSY</a> started with the 44 in 1977, their best selling model.  It was designed for charter by Ted Irwin and Peter Schmidt and is capitally strong.  It comes in mostly cutter \"walk-over\" but also pilothouse, \"walk-through\", and ketch models.  The Antigua 44 is a derivative.  CSY went out of business quickly in 1981, but you can find plenty on the market.  Prices go from $70,000 to $120,000.',120000,''),(45,'Ta Chiao','CT',1975,54,'','','','','','','','','','','','Fiberglass','Robert Perry','','','','','','','',NULL,NULL,'2009-03-19 23:31:36','2009-04-19 16:01:56','Designed by Robert Perry.  Ta Chiao is a low cost Taiwanese manufacturer.  It does not perform the greatest and is more a stylish yacht.  It can be high maintenance and has a somewhat of a bad reputation.  Prices are from 170,000 to 210,000 dollars.',190000,'1 year'),(46,'Endeavour','',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 23:32:53','2009-03-19 23:32:53','',NULL,NULL),(47,'Freedom','',NULL,35,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 23:33:58','2009-03-19 23:33:58','',NULL,NULL),(49,'Freedom','',NULL,45,'','','','','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 23:34:58','2009-04-19 16:21:48','Comes in aft and center cockpits.',NULL,''),(50,'Gozzard','G36',NULL,36,'29\'6\"','42\'','36\'','12\'','4\'9\"','','','20,000 lbs','6,800 lbs.','','','Fiberglass','H. Ted Gozzard','53 gal','222 gal','','','','Diesel','63',NULL,NULL,'2009-03-19 23:35:34','2009-04-17 16:44:30','The G36 is Gozzard\'s most popular model.  They have replaced it with their G37.  Gozzard was started by Ted Gozzard in the 1970\'s and still managed by him with his two sons.  As an independent maker, Gozzard makes special yachts.  In the Gozzard style, the interior is novel with a two person dinette according to <a href=\"http://www.boats.com/news-reviews/article/perry-design-review--gozzard-36-e-type\">Bob Perry</a>.  G36\'s are common on the used market.  Prices range from 120,000 to 180,000 dollars.',180000,'3 years'),(51,'Gulfstar','Center Cockpit',NULL,44,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:28:25','2009-03-21 00:08:47','',NULL,NULL),(52,'Gulfstar','Mark II',NULL,44,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:29:06','2009-03-20 00:29:06','',NULL,NULL),(53,'Gulfstar','Hirsch',NULL,45,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:29:51','2009-03-20 00:29:51','',NULL,NULL),(54,'Gulfstar','Ketch',NULL,50,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:31:10','2009-03-20 00:32:21','',NULL,NULL),(55,'Gulfstar','Ketch Mark II',NULL,50,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:33:44','2009-03-20 00:33:44','',NULL,NULL),(56,'Gulfstar','Sloop',NULL,50,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:34:18','2009-03-20 00:34:18','',NULL,NULL),(57,'Gulfstar','Mark II',NULL,60,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:35:54','2009-03-20 00:35:54','',NULL,NULL),(58,'Gulfstar','Mark I',NULL,60,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:36:46','2009-03-20 00:36:46','',NULL,NULL),(59,'Gulfstar','Sailmaster',NULL,62,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:37:12','2009-03-20 00:37:42','',NULL,NULL),(60,'Hans Christian','Traditional',NULL,33,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:38:17','2009-03-21 00:46:10','',NULL,NULL),(61,'Hans Christian','',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:39:18','2009-03-20 00:39:18','',NULL,NULL),(62,'Hans Christian','',NULL,43,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:42:23','2009-03-20 00:42:23','',NULL,NULL),(64,'Hunter','380',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:43:50','2009-03-20 00:43:50','',NULL,NULL),(65,'Hunter','420 Passage',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:44:17','2009-03-20 00:44:53','',NULL,NULL),(66,'Irwin','',NULL,46,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:46:16','2009-03-20 00:46:16','',NULL,NULL),(67,'Irwin','Mark II',NULL,43,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:47:50','2009-03-20 00:47:50','',NULL,NULL),(68,'Irwin','Mark III',NULL,43,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:48:17','2009-03-20 00:48:17','',NULL,NULL),(70,'Irwin','',1990,52,'','','','','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:51:23','2009-04-19 16:29:36','',NULL,''),(71,'Irwin','384',NULL,52,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:52:12','2009-03-20 00:52:12','',NULL,NULL),(72,'Irwin','',NULL,54,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:52:35','2009-03-20 00:52:35','',NULL,NULL),(73,'Island Packet','',1995,45,'37\'7\"','45\'3\"','','13\'4\"','4\'10\"','','','28,400','12,500','','','Fiberglass','Bob Johnson','140','240','','','','','',NULL,NULL,'2009-03-20 00:53:09','2009-04-19 23:35:59','Won multiple awards coming out as a great cruiser.  <a href=\"http://www.boats.com/news-reviews/article/perry-design-review--island-packet-45\">Perry</a> calls it a handsome boat.  Bob Johnson designed it in 1995 for Island Packet which is still in business and making popular boats.  These are common on the used market.  Try to find one for below $300,000.',280000,'1 year'),(74,'Jeanneau','Sun Odyssey',NULL,40,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:53:55','2009-03-20 00:53:55','',NULL,NULL),(75,'Jeanneau','Sun Odyssey',NULL,51,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:54:33','2009-03-20 00:54:33','',NULL,NULL),(76,'Kanter','',1978,50,'','','','','','','','','','','','Steel','Ted Brewer','','','','','','','',NULL,NULL,'2009-03-20 00:55:13','2009-04-19 23:25:54','Designed by Ted Brewer of Brewer 44 fame by Fort Myers and Widby.  Kanter 50\'s are quiet on the market.',175000,'3 years'),(77,'Jack Kelly','Peterson',1976,44,'','','','','','','','','','','','Fiberglass','Doug Peterson','','','','','','','',NULL,NULL,'2009-03-20 00:57:16','2009-04-19 23:15:53','The forerunner design of so-called performance cruising designed by Doug Peterson.  Jack Kelly Yachts went out of business and no longer makes these Peterson 44\'s.  Mostly known as the Kelly-Peterson or simply Peterson 44.  It improved on the slow nonperformant yet revolutionary designs of the W44 and like.  These cruisers are popular and common on the used market.  Get one for around $100,000.',110000,'2 years'),(78,'Hood','',NULL,51,'40\'9\"','51\'11\"','','15\'2\"','4\'11\"','11\'8\"','','49,440','21,000','','','Fiberglass','Ted Hood','','','','','','','',NULL,NULL,'2009-03-20 00:57:51','2009-04-19 20:52:40','The 51 is very similar to the 51 Little Harbor with both designed by Ted Hood.  People use Hood 51 and Little Harbor 51 interchangeably but should not.  As <a href=\"http://www.boats.com/news-reviews/article/perry-design-review--ted-hood-51\">Perry notes</a>, the Hood 51 is supposed to be a slightly less expensive alternative and is a little larger actually.  It has a very deep maximum draft at 11\'8\".',220000,''),(79,'Morgan','',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:58:38','2009-03-20 00:58:38','',NULL,NULL),(80,'Morgan','',NULL,41,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 00:59:21','2009-03-20 00:59:21','',NULL,NULL),(81,'Morgan','Settee',NULL,41,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:00:38','2009-03-20 01:00:38','',NULL,NULL),(82,'Morgan','',NULL,43,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:01:19','2009-03-20 01:01:19','',NULL,NULL),(83,'Morgan','462',NULL,46,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:02:46','2009-03-20 01:02:46','',NULL,NULL),(84,'Angel Marine','Nassau/Tatoosh',1981,42,'','','','','','','','','','','','Fiberglass','Robert H. Perry','','','','','','','',NULL,NULL,'2009-03-20 01:04:57','2009-04-19 22:51:10','Designed by Robert Perry.  Angel Marine manufactured it in Taiwan and marketed under both the names Nassau and Tatoosh.  Also, listings sometimes show Ta Shing as the manufacturer.  They are moderately heavy cruising boats.  Price from $110,00 to $150,000.  \r\n',130000,'1 year'),(85,'Pacific Seacraft','Crealock',1993,32,'','','','','','','','','','','','Fiberglass','W. I. B. Crealock','','','','','','','',NULL,NULL,'2009-03-20 01:06:24','2009-04-19 21:16:43','Designed by Bill Crealock who also did the original Westsail 32 cruiser.  It is typical Crealock, a big, strong bluewater cruiser.  Price goes from 105,000 to 150,000 and has good, stable market value.  You should find one on the market.  Pacific Seacraft makes all Crealock designs still but is struggling, went bankrupt in 2007, and reformed in 2008.  It is a American maker.',140000,'1 year'),(86,'Ta Shing','Panda',1982,38,'','','','','','','','','','','','Fiberglass','Gary Grant','','','','','','','',NULL,NULL,'2009-03-20 01:07:01','2009-04-20 14:48:26','Pandas are a Gary Grant variation of Robert Perry\'s Baba designs.  Ta Shing, the maker of Taswell, makes Baba and Panda, too.  You can see a <a href=\"http://www.boatmap.co.uk/babapositions.php\">map</a> of the locations of these models.  You can probably find one on the market.\r\n\r\n',120000,'3 years'),(87,'Pearson','424',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:07:38','2009-03-20 01:07:38','',NULL,NULL),(88,'Shannon','',1975,38,'','','','','','','','','','','','Fiberglass','George Stadel, Walt Shultz, David Walters','','','','','','','',NULL,NULL,'2009-03-20 01:08:27','2009-04-19 20:49:01','This is Shannon\'s classic bluewater cruiser in 1975.  Seven kids built it in a Rhode Island boat yard including: Walt Schultz, <a href=\"http://davidwaltersyachts.net/\">Dave Walters</a>, and Bill Ramos, all still active with Shannon yachts.  Backed by Monk Farnham, a yacht reviewer, the 38 became a huge success as an offshore cruiser.  Prices are from $80,000 to $120,000.  ',120000,''),(89,'Dashew Offshore','Sundeer',1995,56,'','','','','','','','','','','','Fiberglass','Steve Dashew','','','','','','','',NULL,NULL,'2009-03-20 01:09:12','2009-04-19 17:41:27','This is a power yacht cruiser made by <a href=\"http://www.setsail.com/dashew/dashoff.html\">Dashew</a> an unusual manufacturer.  They\'ve moved onto avante-gard \"unsailboat\" designs.  These power yachts have pilothouses and are powerful looking.  Sundeer yachts are rare on the used market which pretty steep prices from $450,000 and up.',560000,'2 years'),(90,'Swan','',NULL,47,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:09:45','2009-03-20 01:09:45','',NULL,NULL),(91,'Swan','',NULL,57,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:10:10','2009-03-20 01:10:10','',NULL,NULL),(92,'Tartan','4600',1993,46,'','','','','','','','','','','','Fiberglass','Tim Jacket','','','','','','','',NULL,NULL,'2009-03-20 01:11:13','2009-04-19 17:19:54','Don\'t confuse this one with the older, 1972, Sparkman & Stephens Tartan 46.  This 46\' is a 1993 redesign by the head engineer at Tartan, Tim Jacket.  Twenty-six are around from production years 1993-2004.  Prices range from $280,000 to near $400,000.  <a href=\"http://www.tartanyachts.com/\">Tartan</a> is an American manufacturer of cruisers since 1960.',350000,'2 years'),(93,'Ta Shing','Taswell',1987,49,'','','','','','','','','','','','Fiberglass','Bill Dixon','','','','','','','',NULL,NULL,'2009-03-20 01:11:58','2009-04-19 16:53:02','This Taswell 49 is pictured with 3 cabins layouts.  Ta Shing is one of the many Taiwanese builders along with Queen Long, Tania, and Ta Chiao.  Prices is about $425,000.',425000,'2 years'),(94,'Tayana','Vancouver',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:12:44','2009-03-20 01:12:44','',NULL,NULL),(95,'Tayana','',NULL,55,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:13:08','2009-03-20 01:13:08','',NULL,NULL),(96,'Vagabond','Nina',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:14:02','2009-03-20 01:14:02','',NULL,NULL),(97,'Vagabond','',NULL,47,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:15:29','2009-03-20 01:15:29','',NULL,NULL),(98,'Valiant','',NULL,32,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:16:13','2009-03-20 01:16:13','',NULL,NULL),(99,'Valiant','',NULL,37,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:16:35','2009-03-20 01:16:35','',NULL,NULL),(100,'Valiant','',NULL,40,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:16:56','2009-03-20 01:16:56','',NULL,NULL),(101,'Valiant','',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:17:33','2009-03-20 01:17:33','',NULL,NULL),(102,'Valiant','',NULL,47,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:18:07','2009-03-20 01:18:07','',NULL,NULL),(103,'Valiant','',NULL,50,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:18:24','2009-03-20 01:18:24','',NULL,NULL),(104,'Wauquiez','',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:19:14','2009-03-20 01:19:14','',NULL,NULL),(105,'Wauquiez','Mark II',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:19:41','2009-03-20 01:19:41','',NULL,NULL),(106,'Wauquiez','',NULL,41,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:20:01','2009-03-20 01:20:01','',NULL,NULL),(107,'Wauquiez','Centurion',NULL,47,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 01:20:39','2009-03-20 01:20:39','',NULL,NULL),(108,'Westsail','',1974,42,'33\'4\"','42\'11\"','','13\'','5\'8\"','','','31,500 lbs','11,000 lbs','','','Fiberglass','W. I. B. Crealock','','','','','','','',NULL,NULL,'2009-03-20 01:21:32','2009-04-17 22:08:24','Came in center-cockpit designs and cutter, ketch, or schooner styles.  Westsail went out of business in 1981 and no longer making these yachts.  Westsail rose to fame in the 1970\'s under its 32 model\'s success then crumbled.  They produced 120 of these yachts designed by W. I. B. Crealock.  It is similar to the Westsail 43.  Prices are about 80,000 to 100,000 though a wreck may sell for 40,000 and a great one for 140,000 dollars.  Usually, a couple are for sale.',100000,'2 years'),(109,'Royal Huisman','',1980,41,'','','','','','','','','','','','Aluminum','Sparkman & Stephens','','','','','','','',NULL,NULL,'2009-03-20 01:22:12','2009-04-19 18:52:09','Royal Huisman yachts are rare and custom aluminum makes by a famed British company.  Sparkman and Stephens design them.  You\'ll have to look hard for one of these 41 foot yachts.  Check the European markets.',200000,''),(110,'Elan','431',1990,43,'','43\'',NULL,'13\'','6\'6\"','','','14,000','','6','8','Fiberglass','Jernej and Japec Jakopin','50','105','','Yanmar','','','',NULL,NULL,'2009-03-20 01:22:44','2009-04-17 15:20:22','The Elan 431 is a very clean racer/cruiser with 4 cabins.  It\'s a great sailing machine, great for blue water cruising.  It\'s one of last Elan\'s designed by J&J, now <a href=\"http://www.seaway.si/\">Seaway</a>.  Often, people mistake it as Robert Humphries design.  The 431 emerged as popular European yacht in the 1990\'s.  It is built out of Begunje, Slovenia.  You can usually find a few on the used market for 66,000 to 120,000.',120000,''),(111,'Shearwater','',2000,45,'','','','','','','','','','','','Fiberglass','Dudley Dix','','','','','','','',NULL,NULL,'2009-03-20 01:23:19','2009-04-19 18:00:11','The Shearwater 45 is a recent 2000 award-winning design by <a href=\"http://www.dixdesign.com/sh45.htm\">Dudley Dix</a>.  It is rare on the used market.  Shearwater has also an older 39 foot design.',350000,''),(113,'Tania','Cardinal',1986,46,'','46\'5\"','','13\'1\"','6\'11\"','','','','','','','Fiberglass','Alan Warwick','','','','','','','',NULL,NULL,'2009-03-20 01:27:05','2009-04-18 18:59:26','Also, the Cardinal is called the Warwick Cardinal or just Warwick after its designer, Alan Warwick.  Prices go from 150 to 250 thousand dollars.  The manufacturer is Tania, a Taiwanese maker.  Cardinals are pretty rare on the market.  It is a classic cruiser.',200000,'2 years'),(114,'Nordia','Van Dam',NULL,54,'','','','','','','','','','','','Steel','Rober W. Van Dam','','','','','','','',NULL,NULL,'2009-03-20 01:28:06','2009-04-19 16:47:02','Nordia is an old Dutch company at Vam Dam Shipyard.  This model is a rare perhaps one of a kind custom one.  Nordia makes large yachts with this 54\' one of its smallest.',140000,'2 years'),(115,'Nautical Development','',1979,56,'','','','','','','','','','','','Fiberglass',' Stephen Seaton & R. Warren','','','','','','','',NULL,NULL,'2009-03-20 01:28:51','2009-04-19 22:25:26','Nautical was a Tampa Bay, Florida maker of cruisers which is out of business.  Designed in 1979 by Stephen Seaton, who now does power yachts, and Richard Warren.  It is a cruiser.  The market has pretty few of these 51 Nauticals for between $200,000 and $280,000.  Has a 60\' Nautical sistership.',250000,'3 years'),(116,'Gozzard','G37',NULL,37,'31\'6\"','42\'3\"','37\'','','5\'','','','19,000 Pounds','6,800 Pounds','','','Fiberglass','H. Ted Gozzard','67 gal','157 gal','','','','Diesel','54',NULL,NULL,'2009-03-20 01:30:36','2009-04-17 16:37:47','The G37 is a follow up to the popular G36.  It is still in production in April 2009.  Gozzard is a family owned maker-designer in Ontario, and you can feel their pride in the G37 design.  It comes in an aft cockpit version.  Priced 250,000 to 285,000.',280000,'1 year'),(117,'Camper & Nicholsons','Nicholson',1976,39,'','','','','','','','','','','','Fiberglass','George Nicholson','','','','','','','',NULL,NULL,'2009-03-20 01:32:09','2009-04-19 22:06:45','<a href=\"http://en.wikipedia.org/wiki/Camper_and_Nicholsons\">C&N</a> is the oldest marine manufacturer, started in 1863.  It is a historic British maker passed down through the Nicholson family and now run by George.  As well, Nicholsons have continually designed their own yachts.  Prices range from $50,000 to $90,000 for this 1976 model.',70000,'1 year'),(118,'Hallberg-Rassy','',1982,49,'','49\' 1\"','','14\' 6\"','7\' 3\"','','','39,683','','','','Fiberglass','Olle Enderlein, Christoph Rassy','202','370','','Volvo Penta','TMD41','Diesel','143',NULL,NULL,'2009-03-20 01:32:45','2009-04-19 20:01:46','Built by Hallberg-Rassy, a famous Swedish manufacturer, from 1982 to 1997.  These 49\'s are no longer in production.  It\'s a cruiser which comes in mostly sloop with some ketch models.  Eighty-nine hulls exist.  Usually, one is on the market but not many.  Prices range around $290,000.',290000,'2 years'),(119,'Amel','Sharki',1982,39,'','39\'',NULL,'','6\'10','','','','','','','Fiberglass','Henri Amel J. Carteau','','','','','','','',NULL,NULL,'2009-03-20 21:10:07','2009-04-16 17:52:36','',130000,''),(120,'C&C','110',NULL,36,'27\'8\"','35\'8\"',NULL,'11\'6\"','5\'11\"','','','12,000 pounds','','','','Fiberglass','Rob Ball','','','','','','','',NULL,NULL,'2009-03-20 21:19:39','2009-04-16 22:42:57','According to <a href=\"http://www.cncphotoalbum.com/reviews/perry/c&c36-1.htm\">Robert Perry</a>, the 36 is more handsome than innovative.  It is same type of design by Rob Ball as his 38. She sells well on the used market.  Price is from $120,000 to $190,000.',150000,'2 years'),(121,'C&C','',NULL,41,'33\'4\"','40\'9\"',NULL,'12\'11\"','7\'10\"','','','17,500 pounds','','','','Fiberglass','','','','','','','','',NULL,NULL,'2009-03-20 21:21:49','2009-04-16 23:06:37','The 41 is a legendary racing model.  One named Evergreen won Canada\'s Cup back in 1978 and 1979. Priced from 50,000 to 110,000 dollars.',90000,'2 years'),(122,'C&C','',NULL,44,'','',NULL,'','','','','','','','','Fiberglass','','','','','','','','',NULL,NULL,'2009-03-20 21:23:56','2009-04-16 23:02:12','Priced from 100,000 to 150,000 dollars.',140000,'2 years'),(123,'C&C','Landfall',NULL,48,'','',NULL,'','','','','','','','','Fiberglass','','','','','','','','',NULL,NULL,'2009-03-20 21:25:02','2009-04-16 22:49:45','Priced from $150,000 to $200,000.',170000,'2 years'),(124,'Cabo Rico','XL',1978,38,'','','','','','','','','','','','Fiberglass','W. I. B. Crealock','','','','','','','',NULL,NULL,'2009-03-20 22:34:51','2009-04-18 15:19:23','These XL version of the popular 38 are rare.  Prices have been around $160,000.',160000,'3 years'),(125,'Cabo Rico','Pilot',1978,38,'','','','','','','','','','','','Fiberglass','W. I. B. Crealock','','','','','','','',NULL,NULL,'2009-03-20 22:42:03','2009-04-18 15:18:47','Cabo Rico is still making these, another version of Crealock\'s popular 38\'.  They are rare on the used market.  It is a pilot house version, simply the 38\' with a indoor cockpit.',150000,'2 years'),(126,'Cabo Rico','',1989,34,'','37\'','34\'','11\'','4\'10\"','','',' 	17,400','','','','Fiberglass','W. I. B. Crealock','','','','','','','',NULL,NULL,'2009-03-20 22:44:48','2009-04-18 15:18:07','Comes with an aft cockpit.  Is another Cabo Rico by Crealock.  The 34\' also has a sister 36\' with the same beam, kind of like the 40\'/42\' Cabo Rico sisters.  Prices range from 80,000 to 120,000 dollars with maybe one on the market.',105000,'1 year'),(127,'Cabo Rico','',NULL,40,'','44\'6\"','40\' 6\"','12\'8\"','','5\'3\"','','26,800','','','','Fiberglass','Chuck Paine','','','','','','','',NULL,NULL,'2009-03-20 22:45:15','2009-04-18 14:40:20','Slightly smaller sister to the Cabo Rico 42.  Has the same beam and draft.  It is less common on the market as well.  Designed by <a href=\"http://www.chuckpaine.com/blog/\">Chuck Paine</a>.  It is still in production.  Prices range from 250,000 to 320,000.',310000,'2 years'),(128,'Cabo Rico','',NULL,42,'','46\'6\"','42\'6\"','12\'8\"','5\'3\"','','','26,800','','','','Fiberglass','Chuck Paine','','','','','','','',NULL,NULL,'2009-03-20 22:45:53','2009-04-18 14:40:33','Sistership with the Cabo Rico 40.  Designed by <a href=\"http://www.chuckpaine.com/blog/\">Chuck Paine</a>.  It is still in production.  Prices range from 300,000 to 500,000.  Comes in an aft cockpit version.',345000,'2 years'),(129,'Catalina','380',1996,38,'','','','','','','','','','','','Fiberglass','Gerry Douglas','','','','','','','',NULL,NULL,'2009-03-20 22:50:21','2009-04-18 20:16:51','Comes a an aft cockpit.  This is a complete redesign and not related to the 1977 38\' Catalina model.  The 380 is more like the Morgan 381.  Catalina took over Morgan in 1984.',130000,'1 year'),(130,'Catalina','',1982,36,'','','','','','','','','','','','Fiberglass','Gerry Douglas','','','','','','','',NULL,NULL,'2009-03-20 22:51:14','2009-04-18 20:22:29','Catalina made also MkII 36\' model.  Prices go from $50,000 to $80,000 with many on the market.  The model is the first of Gerry Douglas\' designs.  Catalina stopped making these and now has an different 36 model.',80000,'1 year'),(131,'Catalina','',1989,42,'','','','','','','','','','','','Fiberglass','Gerry Douglas; Nelson-Merek','','','','','','','',NULL,NULL,'2009-03-20 22:51:50','2009-04-18 20:05:06','Comes with an aft cockpit.  Designed by Gerry Douglas, the top engineer at Catalina and a part-owner, from a Nelson-Merek hull.  It is out of production with a Mk II model instead.  Catalina made around 1000 of these original 42\'s.  You find tons of these 42\'s on the market from 80,000 to $140,000.',130000,'1 year'),(133,'Endeavour','',NULL,38,'','','','','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:44:42','2009-04-19 16:22:15','Comes in aft and center cockpits.',NULL,''),(134,'Endeavour','Center Cockpit',NULL,40,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:48:27','2009-03-20 23:48:27','',NULL,NULL),(135,'Endeavour','Ketch',NULL,43,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:48:53','2009-03-20 23:48:53','',NULL,NULL),(136,'Endeavour','Center Cockpit',NULL,52,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:49:42','2009-03-20 23:49:42','',NULL,NULL),(137,'Endeavour','Center Cockpit',NULL,54,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:50:15','2009-03-20 23:50:15','',NULL,NULL),(138,'Freedom','Aft Cockpit',NULL,32,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:54:50','2009-03-20 23:54:50','',NULL,NULL),(139,'Freedom','Aft Cockpit',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:55:10','2009-03-20 23:55:10','',NULL,NULL),(140,'Freedom','Cat Ketch',NULL,39,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:55:26','2009-03-20 23:55:26','',NULL,NULL),(141,'Freedom','Aft Cockpit',NULL,40,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-20 23:55:45','2009-03-20 23:55:45','',NULL,NULL),(142,'Gozzard','G44',NULL,44,'37\'3\"','50\'','44\'','13\'8\"','5\'3\"','','','26000 lbs.','11800 lbs.','','','Fiberglass','H. Ted Gozzard','100 gal','50 gal','','Westerbeke','','','82',NULL,NULL,'2009-03-20 23:59:17','2009-04-17 16:21:52','Comes in a aft and center cockpit versions.  Review by <a href=\"http://www.boats.com/news-reviews/article/perry-design-review--gozzard-44\">Bob Perry</a> talks about its unusual interior with a saloon-stateroom.  Gozzard has G44 A, B, and C version along with a new Mk II version ketch.  The LOA, 50 feet, is in Gozzard\'s honest style much longer than the 44\' model name.  Prices are from 390,000 to 420,000.',420000,'2 years'),(143,'Gulfstar','Aft Cockpit',NULL,36,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:06:10','2009-03-21 00:06:10','',NULL,NULL),(144,'Gulfstar','Aft Cockpit',NULL,37,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:06:26','2009-03-21 00:06:26','',NULL,NULL),(145,'Gulfstar','Center Cockpit',NULL,37,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:06:38','2009-03-21 00:06:38','',NULL,NULL),(146,'Gulfstar','Sailmaster',NULL,39,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:06:54','2009-03-21 00:06:54','',NULL,NULL),(147,'Gulfstar','Center Cockpit',NULL,41,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:07:08','2009-03-21 00:07:08','',NULL,NULL),(148,'Gulfstar','Center Cockpit Ketch',NULL,43,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:07:34','2009-03-21 00:07:34','',NULL,NULL),(149,'Gulfstar','Sailmaster',NULL,47,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:13:02','2009-03-21 00:13:02','',NULL,NULL),(151,'Hinckley','Bermuda',1959,40,'28\'10\"','40\'9\"','40\'8\"','11\'9\"','4\'3\"','8\'8\"','','20,000 lbs','','','','Fiberglass','Bill Tripp','48 gal','110 gal','','','','','',NULL,NULL,'2009-03-21 00:49:14','2009-04-17 19:03:47','Hinckley Bermuda or B40 is one of the most famous designs of all time.  It is one of the first fiberglass yachts.  It vaulted Hinckley into a renowned maker.  They made 203 Bermudas from 1959 to 1991.  It is stylish, sleek, and tough - everything an owner could want.  You can usually find one on the used market with a wild range of prices from 70,000 for a wreck to 300,000 dollars. Bill Tripp, who has passed away, designed the B40.  Hinckley also made a Owens 40 design in 1949 which you should not confuse with the classic Bermuda.  Here is a <a href=\"http://www.boatus.com/jackhornor/sail/Bermuda40.asp\">review</a> by Jack Hornor.',300000,'3 years'),(152,'Hinckley','Sou\'wester',1975,48,'34\'6\"','48\'5\"','','13\'','5\'3\"','9\'9\"','','36000','10950','6.5','7.5','Fiberglass','William H. Tripp Jr.','180','220','','','','','',NULL,NULL,'2009-03-21 00:49:27','2009-04-17 19:37:56','Hinckley only made 5 of these 48 Sou\'westers.  Most of the Sou\'wester models are 42 foot as well as 50, 51, and 59 models.  The 48 Sou\'wester is a yawl version.  These yachts are very rare on the market.  Price should be around 300,000 dollars.',300000,'1 year'),(153,'Hinckley','H-48',1965,48,'34\'2\"','45\'3\"','','13\'','5\'2\"','11\'9\"','','36,000','10,600','','','Fiberglass',' William H. Tripp Jr.','100','250','','Westerbeke','','Diesel','',NULL,NULL,'2009-03-21 00:49:43','2009-04-17 19:29:35','The H-48 is another classic Hinckley design.  The 48 is less common than the famous B40.  It comes as a yawl.  Prices are around 220,000 to 270,000 dollars.  Bill Trip, a pioneer in fiberglass, designed her along with the B40.  Built from 1965 to 1974.',270000,'4 years'),(154,'Hunter','Aft Cockpit',NULL,36,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:54:05','2009-03-21 00:54:05','',NULL,NULL),(155,'Hunter','',NULL,41,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:56:27','2009-03-21 00:56:27','',NULL,NULL),(156,'Hunter','',NULL,44,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:58:20','2009-03-21 00:58:20','',NULL,NULL),(157,'Hunter','',NULL,45,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:59:34','2009-03-21 00:59:34','',NULL,NULL),(158,'Hunter','',NULL,49,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 00:59:42','2009-03-21 00:59:42','',NULL,NULL),(159,'Jeanneau','',NULL,48,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 01:01:02','2009-03-21 01:01:02','',NULL,NULL),(160,'Pearson','422',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 01:03:20','2009-03-21 01:03:20','',NULL,NULL),(161,'Sabre','Aft Cockpit',NULL,34,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 01:06:24','2009-03-21 01:06:24','',NULL,NULL),(162,'Sabre','Aft Cockpit',NULL,36,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 01:06:28','2009-03-21 01:06:28','',NULL,NULL),(163,'Sabre','Aft Cockpit',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 01:09:20','2009-03-21 01:09:20','',NULL,NULL),(164,'Sabre','426',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-21 01:09:27','2009-03-21 01:09:27','',NULL,NULL),(165,'Allied','Wright',1977,40,'29\'9.5\"','40\'25\"',NULL,'12\'','4\'','8\'2\"','','19,000 pounds','','','7.339 knots','Fiberglass','Edmunds/Sparkman & Stevens','100-130 gallons corbin steel','180 gallons','','','','','',NULL,NULL,'2009-04-15 01:17:25','2009-04-17 15:16:34','The Wright 40 is basically a Mistress hull with an extended stern and reverse transom, along with a modernized keel-centerboard underbody. The 40 is an aft-cockpit vessel with a spacious, well-designed interior that includes a large double stateroom aft and two heads. The Wright 40 changes hands sparingly and is a rare find on the market at about 70 to 90K (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',90000,''),(166,'Allied','',1970,39,'28\'10\"','39\'10\"',NULL,'10\'6\"','5\'11\"','','','17,000 pounds','6,700 pounds lead','','7.195','Fiberglass','Owens - Robert Harris','30 gallons','100 gallons','','','','','',NULL,NULL,'2009-04-15 01:23:11','2009-04-17 15:16:49','      Originally Built as Owens-designed wooden cutters, the design was first built in fiberglass by Allen Boat Company and was known as the BORSAW. 6 of these boats were built. The design was then sold to Allied Boat Company and became the Allied 39 with a few changes: the traditional transom was changed to a reverse transom, the underbody was redesigned by Robert Harris to a more modern fin keel, and the beam was widened from 10\' to 10\'5\". With sweeping, classic lines, this is definitely one of Allied\'s best-looking boats. Another famous boat based on the same design is the Hinckley 41, the only difference being an extended stern. A 39 can occasionally be found on the used boat market for 40-80K, hugely depending on the condition (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',80000,''),(167,'Allied','Mistress',1972,39,'29\'','',NULL,'12\'','4\'6\"','','','20,800 pounds','5,600 pounds','','7.216','Fiberglass','Arthur Edmunds','80 gallons','140 gallons','','','','','',NULL,NULL,'2009-04-15 16:13:48','2009-04-17 15:17:06','Designed in April 1971 by Arthur Edmunds, the Mistress was the first center-cockpit boat to come to the market with a walk-through passageway connecting the fore and aft cabins. During the 1972 New York Boat Show, there were 15-20 people waiting in line to see the Mistress during the entire show. Known for its roomy interior and rugged construction, the Mistress was featured in the \"Classic Plastic\" article in the December 1997 issue of Cruising World. The Mistress is a very comfortable offshore boat with its keel-stepped main mast and two heads, great for making extended offshore passages. The center cockpit version includes a walk-in engineroom, an aft cabin with standing headroom, a workbench, and a fixed dinette table. Two versions of the center cockpit Mistress were produced, an aft-cabin, and a \"Great Cabin\" with the aft cabin extended all the way to the transom. A total of approximately 60 Mistresses were constructed, including the Mistress Mark III, an aft-cockpit version. The Mk III made excellent use of the smaller interior space it had, featuring berths for five, swivel chairs, and a drop-leaf dining table. A Mistress can be found on the used-boat market for $45,000 to $60,000 (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',60000,''),(168,'Allied','Contesa',1973,36,'','36\'',NULL,'11\'','','','','14,400 pounds','5000 pounds','','','Fiberglass','Edmunds','40 gallons','90 gallons','','','','','',NULL,NULL,'2009-04-15 16:21:52','2009-04-17 15:17:16','The Contessa was brought to the market in 1973 as a center-cockpit version of the popular Allied Princess. The Contessa had such features as a walk-thru passageway connecting the fore and aft cabins, a keel stepped main mast, a ketch rig, and two heads. Despite its excellent design and long list of features, the Contessa never sold well because buyers thought that they could get more boat for their money with the Mistress 39 (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',30000,''),(169,'Allied','Princess',1972,36,'27\'6\"','36\'',NULL,'11\'','4\'6\"','','','','','','7.027 knots','Fiberglass','Edmunds','37-70 gallons (most 40)','60-100 gallons (most 80)','','','','','',NULL,NULL,'2009-04-15 16:32:10','2009-04-17 15:17:27','     Designed in May of 1972 and kept in production until late 1981, the Princess was most likely Allied\'s most popular boat of the time. Originally available as only a ketch or sloop, a cutter option was added as an option on the Princess II, the successor of the original Princess. The Princess II came to the market in late 1977 and featured an enclosed quarter cabin, a bowsprit, and more ports. The changes between the Princess and Princess II were nothing compared to what happened to the Seawind to make the Seawind II, so the differences are not significant enough to change a buying decision. Approximately 140 were constructed, including 12 Princess IIs that were built with 5\'1\" drafts, reinforced transoms, larger cockpit drains, and higher lifelines. Wallace Hale owns one of the 12 and can be contacted with your questions. The Princess was one of the three Allied models featured as \"Classic Plastic\" in the December 1997 issue of Cruising World. A Princess can be found used for 40 to 50K. Expect to pay closer to 60K for a newer Princess II (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',50000,''),(170,'Allied','Seabreaze',1964,35,'24\"','34\'6\"',NULL,'','3\"10\"','7\'','','13,400 pounds','4,000 pounds lead (includes weight of bronze centerboard)','','6.565 knots','Fiberglass','MacLear & Harris','25-45 gallons (most 30)','25-90 gallons (most 45)','','','','','',NULL,NULL,'2009-04-15 16:39:38','2009-04-17 15:17:37','The Seabreeze 35 was the smallest keel-centerboard boat built by Allied. Rigged as a sloop, yawl, or ketch, the Seabreeze is known for its sailing ability and bluewater potential. With rugged features such as a solid bronze centerboard, Seabreezes are well-suited to ocean-sailing. In 1967, the 380 pound bronze centerboard was replaced with a 115 pound aluminum one. In 1970, The Seabreeze was improved much more significantly. Called the Seabreeze Citiation, the new model featured an improved interior layout with increased storage space and a revised cockpit. The Seabreeze was recognized as one of \"Twenty Great Used-Boat Bargains\" in the October 1994 issue of Cruising World, as well as \"Classic Plastic\" in the December 1997 issue. One can be found on the used-boat market from between $35,000 to $48,000. A total of 135 were made (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',48000,''),(171,'Allied','Luders',1966,33,'24\'','33\'',NULL,'10\'','5\'','','','12,800 pounds','4,500 pounds lead','','6.565 knots','Fiberglass','Bill Luders','20-30 gallons','45-75 gallons','','','','','',NULL,NULL,'2009-04-15 16:52:17','2009-04-17 15:17:49','Designed by Bill Luders, the Luders 33 accomplished such feats as being the boat that Robin Lee Graham circumnavigated the world in, becoming the youngest person to ever do so. The design was that of a typical Racer/Cruiser from the 1960s and has a strong ownership following. There is an active Owners Association that can be reached at (860)445-2380. Featured as one of \"Twenty Great Used Boat Bargains\" in the October 1994 issue of Cruising World, the Luders 33 featured heavy construction with a design emphasis on seakeeping ability. One can be found on the used-boat market for $28,000 to $35,000 (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',35000,''),(172,'Allied','Seawind II',1975,32,'25\'6\"','31\'7\"',NULL,'','4\'6\"','','','14,900 pounds','5,800 pounds','','6.767 knots','Fiberglass','Gillmer','30-40 gallons (most 40)','60-80 gallons (almost all 60)','','','','','',NULL,NULL,'2009-04-15 16:56:21','2009-04-17 15:18:02','The Seawind II came to the market in 1975 as the successor to the original Seawind. Production of the Seabreeze, Luders, and Chance 30-30 was also stopped in favor of the Seawind II. Many improvements were made to the Seawind to form the Seawind II. It was over a foot longer, over a foot wider, carried 55 more square feet of sail area, and weighed an additional 2100 pounds. In my opinion, if you are looking for a boat in the low 30\' range, there is no better than a Seawind II. Like all Allieds, all the deck hardware is oversized and built to last. This hardware makes for a rig that can support 14,500 pounds - nearly the weight of another Seawind II! With an enormous ballast of 5800 pounds (200 more than a Mistress), expect the boat to remain upright in all but the fiercest of winds, and it should self-right quickly after a knockdown. A variety of interior arrangements slept between four and six using combinations of pilot berths or slide out double berths in the main cabin and a tradition V-berth in the bow. Compared to the original Seawind, the interior is noticeably larger and better finished, and the hull-to-deck joint was sealed better to stop leaks, a common problem with the original Seawind. The Seawind II\'s hull-to-deck joint has an inward flange sealed with 3M 5200 and through-bolted. The entire flange is then fiberglassed over on the inside, and the outside joint is covered by an aluminum strip the length of the boat, making for as fail-proof a joint as you will find. The majority of Seawind II\'s were sold as ketches, but cutters became more popular in the last years of production. Two were built as sloops. A Seawind II can be found on the used-boat market for around $35,000 to $45,000 (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',45000,''),(173,'Allied','Seawind',1962,30,'24\'','30\'6\"',NULL,'9\'3\"','4\'2\"','','','12,080 pounds','4,200 pounds lead','','6.565 knots','','Gilmer','20-40 gallons','30-40 gallons','','','','','',NULL,NULL,'2009-04-15 17:03:13','2009-04-17 15:18:16','The Seawind was the first, as well as one of the last, boats built by Allied Boat Company. It was first created in 1962 and soon became the first fiberglass boat to sail around the world. It was however, replaced by the larger Seawind II in 1975. The original Seawind was put back into production, along-side the Seawind II, in 1978 and a few were constructed from this time until Allied went out of business in 1981. Thus far, there have been nine circumnavigations in Seawinds. One can be easily found on the used boat market for $15000 to $25000. On a side-note, Allied was actually not the first company to build the Seawind. Gillmer initially designed the boat for Kaiser Gale Force Yachts (Builder of the remarkable Kaiser 34) in 1961. The first one built, Seawind One, is owned by Brett Harding. Kaiser soon sold the molds to Allied who, after changing the cabin top and port arrangement, began building in 1962. The vast majority of Seawinds are ketch-rigged, although they were also available as a sloop (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',25000,''),(174,'Allied','Chance 30-30',1971,30,'25\'','30\'6\"',NULL,'10\'','5\'3\"','','','11,200 pounds','6,500 pounds','','6.7','Fiberglass','Britton Chance','25 gallons','40 gallons','','','','','',NULL,NULL,'2009-04-15 17:07:34','2009-04-17 15:18:32','The Chance 30-30 was the one and only racing boat built by Allied Boat Company during the 20 years of its existence. Allied turned to one of the greatest racing boat designers of the time, Britton Chance of Hughes Aerospace, to design the boat. In addition to the 30-30, Chance also designed America\'s Cup winner Intrepid and was one of the first designers to use carbon fiber in the marine industry. Applying his incredible skills to the 30-30, he created an incredibly fast boat, particularly when compared to the other models of Allied, a company that made its name from overbuilt, ocean-going cruisers (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',20000,''),(175,'Allied','Greenwich',1968,24,'17\'5\"','24\'3\"',NULL,'7\'3\"','3\'','','','3,825 pounds','1,500 pounds','','5.606 knots','Fiberglass','Stadel','','15 gallons','','','','','',NULL,NULL,'2009-04-15 17:15:30','2009-04-17 15:18:43','The Greenwich 24 was the smallest boat Allied ever produced. It was an excellent boat for small bodies of water (everything but the open ocean) because it lacked cruising needs such as an inboard engine or a fixed head. The design was sold to the new Cape Dory Company to become the successful Cape Dory 25 in 1972. A Greenwich can be purchased for about $4,500 up to around $7500 (<a href=\"http://www.geocities.com/TimesSquare/Arcade/9282/boatsindex.html\">Allied Boat Company</a>).',7500,''),(176,'C&C','',NULL,38,'31\'','37\'55\"',NULL,'12\'8\"','7\'6\"','','','','','','','Fiberglass','Rob Ball','','','','','','','',NULL,NULL,'2009-04-16 22:28:44','2009-04-16 22:28:44','George Cuthbertson and George Cassian started C&C in 1961 and make a name building racers.  The 38 is light and fast.  38\'s are common on the used market with another 38 C&C model, Landfall.  They have a deep draft at 7\'6\".  Prices are under $100,000.',70000,'2 years'),(177,'Westsail','',1974,43,'33\'4\"','42\'11\"','','13\'','5\'8\"','','','31,000 lbs','11,000 lbs','','','Fiberglass','W. I. B. Crealock','','','','','','','',NULL,NULL,'2009-04-17 22:18:45','2009-04-17 22:20:53','Similar but slightly rarer than the 42 with 65 made.  They actually share the same hull designs.  It follows the Westsail motto \"built like a tank, but unfortunately sails like one too.\"  It is a big, bad cruiser.  Prices are around 90,000 to 125,000 with one probably on the market.',115000,'1 year'),(178,'Westsail','W32',1971,32,'27\'6\"','32\'','','11\'','5\'','','','19,500 lb','7,000 lb','','','Fiberglass','W. I. B. Crealock','','','','','','','',NULL,NULL,'2009-04-17 22:35:05','2009-04-17 22:35:05','The <a href=\"http://en.wikipedia.org/wiki/Kendall_32#cite_note-11\">W32</a> made the Westsail name.  830 W32\'s exist with many that their owners built from kits!  Made from 1971 to 1980.  Westsail could not meet the ravaging demand.  This yacht is one of the classics of all time.  It inspired, like the Hinckley 40, a new generation of designers and manufacturers.  And like the Allied yachts, W32 like Satori survived through a perfect storm in 1991 with on $10,000 in damage.  With the large number made, these are common on the used market from $30,000 to $65,000.',60000,'1 year'),(179,'Little Harbor','',1990,51,'41\'','50\'7\"','','15\'3\"','4\'7\"','11\'9\"','','','','','','Fiberglass','Ted Hood','','','','','','','',NULL,NULL,'2009-04-19 20:20:34','2009-04-19 22:53:15','Perry has a <a href=\"http://www.boats.com/news-reviews/article/perry-design-review--little-harbor-51\">review</a> and says she is a typical Hood design.  Little Harbor\'s are expensive boats.  Hinckely, who made the famed Bermuda 40, acquired Little Harbor in 1998.  Prices can go as high as a million for a really fancy one.  These 51\'s are rare on the market.  They have deep drafts at 11\'9\".',670000,'');
